import React from 'react';
import Tilt from 'react-vanilla-tilt';
import './ImageCard.css';

const ImageCard = ({image, name}) => {
    return (
        
        
        <div className='card2 col-md-4'>
            <Tilt className='content box' options={{ max: 25, speed: 300 }}>
                    <h4>{name}</h4>
                    <img className='card-img singleImage' src={image} alt='card' />
            </Tilt>  
        </div>
        
        
            
        
